import { Injectable } from '@angular/core';
import { Song } from './song/Song';

@Injectable({
  providedIn: 'root'
})

export class RatesService {

  rateList: Song[] = [];
  rates: number[] = [];

  constructor() { }

  rate(song: Song) {
    console.log(song);
    if(!this.rateList.find((v1) => v1.name == song.name)){
      this.rateList.push({... song});
    }
  }
}
